package com.example.daktariplus.model;public class MedicalRecordModel {    String id,treatment_date,hospital_name,medical_condition, fee_charged,patient_id, doctor_id;    public MedicalRecordModel(String id, String treatment_date, String hospital_name, String medical_condition, String fee_charged, String patient_id, String doctor_id) {        this.id = id;        this.treatment_date = treatment_date;        this.hospital_name = hospital_name;        this.medical_condition = medical_condition;        this.fee_charged = fee_charged;        this.patient_id = patient_id;        this.doctor_id = doctor_id;    }    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    public String getTreatment_date() {        return treatment_date;    }    public void setTreatment_date(String treatment_date) {        this.treatment_date = treatment_date;    }    public String getHospital_name() {        return hospital_name;    }    public void setHospital_name(String hospital_name) {        this.hospital_name = hospital_name;    }    public String getMedical_condition() {        return medical_condition;    }    public void setMedical_condition(String medical_condition) {        this.medical_condition = medical_condition;    }    public String getFee_charged() {        return fee_charged;    }    public void setFee_charged(String fee_charged) {        this.fee_charged = fee_charged;    }    public String getPatient_id() {        return patient_id;    }    public void setPatient_id(String patient_id) {        this.patient_id = patient_id;    }    public String getDoctor_id() {        return doctor_id;    }    public void setDoctor_id(String doctor_id) {        this.doctor_id = doctor_id;    }}